import React from 'react';

const Container = () => {
  return  (
  	<div className='Container'>
		<nav>
	    	<div class="nav-wrapper orange lighten-3">
	    	<h5 class="brand-logo girlNextDoor">Westiny</h5>
	    	</div>
	    </nav>

	    <div class="container">
		    <h1 className='girlNextDoor'>Discover the colorful world</h1>
		    <h4 className='Dosis'>New Adventure</h4>
		    <p className='Dosis'>A social media to find tips & tricks to have a perfect vacation and qualify the places that you visit.</p>
	    	<button class="btn deep-orange darken-4 pulse pa4" type="submit" name="action">Submit</button>
	    	<button class="btn deep-orange darken-4" type="submit" name="action">Submit</button>
	    </div>
	</div>
    );
}

export default Container;
